import React, { useContext } from 'react';
import { useNavigate } from 'react-router-dom';
import { cartStore } from './CartStore';
import { usePopup } from './PopupProvider';
import './Stores.css';  // ייבוא קובץ ה-CSS

const JapanikaMenu = () => {
  const navigate = useNavigate();
  const { setImages, setVisible } = usePopup();

  const menu = [
    { name: 'Sushi Platter', price: 50, images: [
      "data:image/jpeg;base64,"
    ]},
    { name: 'Ramen Bowl', price: 35,images: [
      "data:image/jpeg;base64,"
    ]},
    { name: 'Tempura Udon', price: 30,images: [
      "data:image/jpeg;base64,"
    ] },
    { name: 'Teriyaki Chicken', price: 40,images: [
      "data:image/jpeg;base64,"
    ] },
    { name: 'Salmon Sashimi', price: 45 ,images: [
      "data:image/jpeg;base64,"
    ]},
   
    { name: 'Gyoza', price: 25,images: [
      "data:image/jpeg;base64,"
    ] },
    { name: 'Miso Soup', price: 15,images: [
      "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ2DMJayoI6u4plUPd5MFzkxM6ipAW8J775_w&s"
    ] },
    { name: 'Edamame', price: 12 ,images: [
      "data:image/jpeg;base64,"
    ]},
    { name: 'Green Roll Sushi', price: 38,images: [
      "data:image/jpeg;base64,"
    ] },
    { name: 'Spicy Tuna Roll', price: 32,images: [
      "data:image/jpeg;base64,"
    ] },
  ];

  const goToCart = () => {
    navigate('/cart');
  };

  const handleImage = (images) => {
    setVisible(true);
    setImages(images);
  };

  return (
    <div className="menu-container Japanika-menu-container">
      <h2>Japanika Menu</h2>
      <ul>
        {menu.map((item, index) => (
          <li key={index}>
            {item.name} - {item.price} ₪
            <div className="resButtons">
              {item.images && <button onClick={() => handleImage(item.images)}>צפה במוצר</button>}
              <button onClick={() => cartStore.addItem(item)}>+</button>
            </div>
          </li>
        ))}
      </ul>
      <button className="go-to-cart-button" onClick={goToCart}>Go to Cart</button>
    </div>
  );
};

export default JapanikaMenu;
